import React from 'react';

const Contact = () => {
  return (
    <section className='mt-44 px-10'>
        <div className='text-8xl px-96 text-center flex'>Hi there! Can't find what you need?</div>
        <div className='text-base flex flex-row'>Please get in touch and our support team will answer all your questions.You can send a message to  <span className='flex flex-row'>&nbsp;neurox.co.uk</span></div>
    </section>
  )
}

export default Contact
